sys_variable_value.value:
(function execute(inputs, outputs) {

    var payload = {
        name: {
            givenName: inputs.givenName,
            familyName: inputs.familyName
        },
        password: inputs.password,
        primaryEmail: inputs.primaryEmail
    }
    if (inputs.gender_type) {
        var gender = {};
        gender.type = inputs.gender_type;
        payload.gender = gender;
    }
    if (inputs.change_password_next_login)
        payload.changePasswordAtNextLogin = inputs
        .change_password_next_login;

    var emails = [];
    if (inputs.emails) {
        gs.info("I am narsing " + JSON.stringify(email));
        for (var i = 0; i < inputs.emails.length; i++) {
            var email = {};
            var emailObj = inputs.emails[i];
            if (emailObj.Address)
                email.address = emailObj.address;

            if (emailObj.Custom_Type)
                email.customType = emailObj.customType;

            if (emailObj.Primary)
                email.primaryprimary = emailObj.primary;

            if (emailObj.Type)
                email.type = emailObj.type;

            gs.info("object " + JSON.stringify(email));

            if (Object.keys(email).length > 0) {
                emails.push(email);
            }
        }
    }
    if (emails.length > 0)
        payload.emails = emails;

    var addresses = [];
    if (inputs.addresses) {
        for (var i = 0; i < inputs.addresses.length; i++) {
            var address = {};
            var addressObj = inputs.addresses[i];
            if (addressObj.country)
                address.country = addressObj.country;
            if (addressObj.Street_Address)
                address.streetAddress = addressObj.Street_Address;
            if (addressObj.PO_BOX)
                address.poBox = addressObj.PO_BOX;
            if (addressObj.Postal_Code)
                address.postalCode = addressObj.Postal_Code;
        }
        if (Object.keys(address).length > 0)
            addresses.push(address);
    }

    if (addresses.length > 0)
        payload.addresses = addresses;

    outputs.payload = JSON.stringify(payload);
})(inputs, outputs);

